import React, { useState } from 'react';
import './styles.css';

function Experience() {
  const [isHovered, setIsHovered] = useState(false);

  const handleMouseEnter = () => setIsHovered(true);
  const handleMouseLeave = () => setIsHovered(false);

  return (
    <div style={styles.container}>
      <div style={styles.timelineContainer}>
        <h1 style={styles.sectionTitle}>Education</h1>
        <div style={styles.timeline}>
          <div style={styles.timelineItem}>
            <div style={styles.marker}></div>
            <div
              className="card"
              style={isHovered ? styles.cardHovered : styles.card}
              onMouseEnter={handleMouseEnter}
              onMouseLeave={handleMouseLeave}
            >
              <p style={styles.date}>2022 - 2026</p>
              <h2 style={styles.cardTitle}>Georgia Institute of Technology</h2>
              <p style={styles.cardSubtitle}>Bachelor of Science in Computer Science</p>
              <p style={styles.cardDescription}>
                Thread in System & Architecture and Intelligence
              </p>
            </div>
          </div>
        </div>

        <h1 style={styles.sectionTitle}>Extracirrculars</h1>
        <div style={styles.timeline}>
          <div style={styles.timelineItem}>
            <div style={styles.marker}></div>
            <div
              className="card"
              style={isHovered ? styles.cardHovered : styles.card}
              onMouseEnter={handleMouseEnter}
              onMouseLeave={handleMouseLeave}
            >
              <p style={styles.date}></p>
              <h2 style={styles.cardTitle}>Automated Algorithm Design</h2>
              <p style={styles.cardSubtitle}>Undergraduate Machine Learning Researcher</p>
              <p style={styles.cardDescription}>
                Accelerate NAS by developing surrogate models to predict network performance, reducing computational costs by approximating architecture evaluation across search spaces.
              </p>
            </div>
          </div>
          {/* Other timeline items go here */}
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'start',
    paddingLeft: '20rem',
    backgroundColor: '#ffffff',
    color: '#333333',
    fontFamily: 'Roboto, Arial, sans-serif',
    minHeight: '80rem',
  },
  timelineContainer: {
    maxWidth: '700px',
    padding: '1.5rem',
  },
  sectionTitle: {
    fontSize: '2rem',
    fontWeight: 'bold',
    color: '#333333',
    marginBottom: '1.5rem',
  },
  timeline: {
    position: 'relative',
    paddingLeft: '18px',
    borderLeft: '2px solid #cccccc',
    marginBottom: '3rem',
  },
  timelineItem: {
    display: 'flex',
    alignItems: 'flex-start',
    marginBottom: '2.5rem',
  },
  marker: {
    width: '10px',
    height: '10px',
    backgroundColor: '#333333',
    borderRadius: '50%',
    position: 'relative',
    left: '-20px',
    top: '8px',
  },
  date: {
    fontSize: '1rem',
    color: '#666666',
    marginBottom: '0.6rem',
  },
  cardTitle: {
    fontSize: '1.4rem',
    fontWeight: 'bold',
    color: '#333333',
    marginBottom: '0.6rem',
  },
  cardSubtitle: {
    fontSize: '1rem',
    fontStyle: 'italic',
    color: '#666666',
    marginBottom: '1rem',
  },
  cardDescription: {
    fontSize: '0.9rem',
    lineHeight: '1.8',
  },
  card: {
    padding: '1.5rem',
    backgroundColor: '#f9f9f9',
    border: '1px solid #ddd',
    borderRadius: '8px',
    transition: 'all 0.3s ease-in-out',
  },
  cardHovered: {
    ...this.card,
    transform: 'scale(1.05)',
    boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.1)',
  },
};

export default Experience;
